    false,nt"url": null,nt"notes": "NODC Accession 0129832 includes physical,
    profile and underway data collected aboard the ROGER REVELLE during cruise RR1010
    in the Philippine Sea and South China Sea (Nan Hai) from 2010-07-31 to 2010-08-12.
    These data include CONDUCTIVITY, CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT
    SPEED - NORTH/SOUTH COMPONENT (V), SALINITY and WATER TEMPERATURE. The instruments
    used to collect these data include ADCP, CTD and GPS. These data were collected
    by Hans Graber of University of Miami, and by University of California - San Diego;
    Scripps Institution of Oceanography as part of Air-Sea Interactions in Typhoon Conditions.
    The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC as part
    of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe ADCP data represent
    the raw and automated processed data set. Post processed quality assessed data are
